import React from 'react';
import s from './TextBlock.module.css';


const TextBlock = () => {
    
    return (
        <div>
            <div className={s.textBlockBg}>
                <div className={s.wrap}>
                    <h2 className={s.textTitle}>Editorial Foreword</h2>
                    <p className={s.descr}>Хочете побачити країну у всій її красі, але не визначилися, що подивитися в Україні?  Цей сайт створений для втілення в життя мрії про ідеальну подорож! 
                    Оберіть тур та модифікуйте його за бажання. Всі тури розроблено з любов'ю до мандрівників нашою країною. Обирайте те, що подобається саме вам.</p>
                </div>
            </div>
        </div>
    );
}

export default TextBlock;
